import React, { Component } from 'react';
import {Route, Redirect, Switch } from 'react-router-dom';
import {Navbar, Nav, NavItem, ListGroup, ListGroupItem} from 'react-bootstrap';
import {LinkContainer} from 'react-router-bootstrap';
import Carousel from 'react-simply-carousel';
import {NavigationBar} from '../components';
import './Home.css';

var ProtectedRoute = ({component: Cmp, path, ...rest }) => {
   return (<Route path={path} render={(props) => {
      return Object.keys(rest.Usr).length !== 0 ?
      <Cmp {...rest}/> : <Redirect to='/signin'/>;}}/>);
   };

class Home extends Component {

   // signedIn() {
   //    return Object.keys(this.props.Usr).length !== 0; // Nonempty Prss obj
   // }
   state = {
      activeSlideIndex: 0,
   }
   setActiveSlideIndex = (newActiveSlideIndex) => {
      this.setState({
        activeSlideIndex: newActiveSlideIndex
      });
    }
   render() {
      console.log("Redrawing homepage");
      return (
         <div>
            <NavigationBar />
         <div>
         <Carousel
            activeSlideIndex={this.state.activeSlideIndex}
            onRequestChange={this.setActiveSlideIndex}
            itemsToShow={3}
            itemsToScroll={3}
            >
            <div style={{ width: 300, height: 300 }}>slide 0</div>
            <div style={{ width: 300, height: 300 }}>slide 1</div>
            <div style={{ width: 300, height: 300 }}>slide 2</div>
            <div style={{ width: 300, height: 300 }}>slide 3</div>
            <div style={{ width: 300, height: 300 }}>slide 4</div>
            <div style={{ width: 300, height: 300 }}>slide 5</div>
            <div style={{ width: 300, height: 300 }}>slide 6</div>
            <div style={{ width: 300, height: 300 }}>slide 7</div>
            <div style={{ width: 300, height: 300 }}>slide 8</div>
            <div style={{ width: 300, height: 300 }}>slide 9</div>
         </Carousel>
         </div>

            {/*Alternate pages beneath navbar, based on current route*/}
            {/* <Switch>
               <Route exact path='/'
                  component={() => Object.keys(this.props.Prss).length !== 0 ? 
                     <Redirect to="/allCnvs" /> : <Redirect to="/signin" />} />
                 <Route path='/signin' 
                  render={() => <SignIn {...this.props} />} />
                 <Route path='/register'
                  render={() => <Register {...this.props} />} />
                 <ProtectedRoute path='/allCnvs' component={CnvOverview}
                  {...this.props}/>
                 <ProtectedRoute path='/myCnvs' component={CnvOverview}
                  userOnly={true} {...this.props}/>
                  <ProtectedRoute path={`/CnvDetail/`} component={CnvDetail}
                  userOnly={true} {...this.props}/>
               />

               />
            </Switch> */}

         </div>
      )
   }
}

export default Home;
